__NUXT_JSONP__("/drugs/Sagopilone", (function(a,b){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"305841-29-6",chebiId:"",chemicalFormula:"C30H41NO6S",definition:"A fully synthetic low-molecular-weight epothilone with potential antineoplastic activity. Sagopilone binds to tubulin and induces microtubule polymerization while stabilizing microtubules against depolymerization, which may result in the inhibition of cell division, the induction of G2\u002FM arrest, and apoptosis. The agent is not a substrate for the P-glycoprotein (P-gp) efflux pump and so may exhibit activity in multidrug-resistant (MDR) tumors. The epothilone class of metabolites was originally isolated from the myxobacterium Solangium cellulosum.",fdaUniiCode:"KY72JU32FO",identifier:"C61072",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C1922","C67437"],synonyms:["(1S,3S,7S,10R,11S,12S,16R)-7,11-dihydroxy-8,8,12,16-tetramethyl-3-(2-methyl-1,3-benzothiazol-5-yl)-10-(prop-2-enyl)-4,17-dioxabicyclo(14.1.0)heptadecane-5,9-dione","DE-03757","Epothilone ZK219477","SAGOPILONE","SH-Y03757A",a,"ZK-219477","ZK-EPO","ZK-Epothilone","epothilone ZK219477"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FSagopilone",extension:".json",createdAt:b,updatedAt:b}}],fetch:{},mutations:void 0}}("Sagopilone","2021-10-30T13:41:16.903Z")));